import { courseService } from "../../Services"
import { createAction } from "."
import { FETCH_COURSES } from "./type"

//hàm chứa phương thức bất đồng bộ
export const fetchCourse = () => {
    return dispatch => {
        courseService
        .fetchCourse()
            .then(res => {
                dispatch(createAction(FETCH_COURSES, res.data))
                console.log(res);              
            })
            .catch(err => {
                console.log(err)
            })
    }
}
